import React, { Component } from 'react';
import { Redirect } from 'react-router-dom';
import { NonIdealState, H5, H3, Button } from '@blueprintjs/core';

export default class Route404 extends Component {
   constructor(props) {
      super(props);
      this.state = {
         goHome: false
      };

      this.handleGoHome = this.handleGoHome.bind(this);
   }
   handleGoHome = e => {
      e.preventDefault();
      this.setState({
         goHome: true
      });
   };

   render() {
      const title = <H3>Path not found</H3>;
      const description = (
         <>
            <H5>Path you are looking for do not exist</H5>
            <br />

            <Button
               icon='home'
               minimal
               fill
               onClick={this.handleGoHome}
            ></Button>
         </>
      );

      if (this.state.goHome) {
         return <Redirect to='/home' />;
      }

      return (
         <NonIdealState
            icon='error'
            title={title}
            description={description}
            action=''
         />
      );
   }
}
